import React from 'react';

import {Route,} from "react-router-dom";
import Routes from "./constants/routes";
import './App.css';

import {
    Categories,
    Login,
} from "./components";

const App = () => {
  return (
      <div className="App">
          <Route  path={Routes.INDEX} component={Categories} />
          <Route  path={Routes.LOGIN} component={Login} />
      </div>
  );
};

export default App;
